import Home from "../components/home";
import Not404 from "../components/not404";
import ShopDetail from "../components/shopDetail";
import Classify from "../components/classify";

const routes = [
    {
        exact:true,
        path:"/",
        component:Home
    },
    {
        path:"/shopDetail",
        component:ShopDetail
    },
    {
        path:"/classify",
        component:Classify
    },
    {
        path:"*",
        component:Not404
    }
];
export default routes;
